INSERT INTO `lessons` VALUES (89,79,'АСП алу үшін керек құжаттар. \"АЛИМЕНТ АЛМАЙДЫ\" деген справканы қайдан аламыз?','<p><iframe src=\"https://www.youtube.com/embed/TjufUNePsaE\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,'uploads/1607597717FCthE.png',NULL,NULL,2581,NULL,'2020-12-10 10:55:17','2021-09-26 10:22:13'),(99,79,'Жалақым 80000 тг, айына төлейтін кредитім 150000тг. Банкты сотқа бере аламын ба?','<p><iframe src=\"https://www.youtube.com/embed/Ne6zLuxd26c\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',NULL,NULL,'uploads/1607946205Ny415.png',NULL,NULL,3102,NULL,'2020-12-14 11:43:25','2021-09-26 02:33:32'),(100,79,'Оптимальный графиктегі кредитті қалай тиімді жабамыз?','<p><iframe src=\"https://www.youtube.com/embed/F8V1WjLdL2w\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',NULL,NULL,'uploads/1607946275bMfI1.png',NULL,NULL,4598,NULL,'2020-12-14 11:44:35','2021-09-26 11:53:29'),(101,79,'Балам ауырса маған больничный төленеді ме?','<p><iframe src=\"https://www.youtube.com/embed/n0MljL9NQfE\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,'uploads/1607946321KXO4l.png',NULL,NULL,1430,NULL,'2020-12-14 11:45:21','2021-09-27 09:07:05'),(138,90,'Альянс банктен алған кредитті төлемеудің заңды жолы','<p><iframe src=\"https://www.youtube.com/embed/qW48sQoblD0\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',NULL,NULL,'uploads/1609955353d94S3.png',NULL,NULL,3993,NULL,'2021-01-06 17:49:13','2021-09-27 09:01:36'),(139,91,'Қосымша табыс көздері','<p><iframe src=\"https://www.youtube.com/embed/EibedrtjUhQ\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,'uploads/1610106534ZD8el.png',NULL,NULL,9854,NULL,'2021-01-08 11:48:54','2021-09-27 10:14:01'),(208,97,'1 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"1