йін алимент өндіру','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1612412557zRRlm.mp4\" type=\"video/mp4\" /></video></p>','',NULL,'uploads/1614532164V8cng.png',NULL,NULL,49,NULL,'2021-02-28 17:09:24','2021-08-22 06:20:53'),(222,97,'Бонус сабақ - 2. Бұрынғы зайыбына алимент өндіру','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1612412823YZEwF.m4v\" /></video></p>','',NULL,'uploads/1614532197SCARf.png',NULL,NULL,39,NULL,'2021-02-28 17:09:57','2021-08-27 18:58:25'),(223,97,'Бонус сабақ - 3. Алимент ақшасын аресттен босату','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\" \">\r\n<source src=\"http://185.113.134.102/videos/16124132601dF9o.m4v\" /></video></p>','',NULL,'uploads/1614532229NWaz8.png',NULL,NULL,27,NULL,'2021-02-28 17:10:29','2021-08-27 18:58:54'),(225,103,'1 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1617013531eEtp1.m4v\" /></video></p>\r\n<p>&nbsp;</p>\r\n<p>Өмірді мағыналы сүру үшін, уақытты &ndash; тағы бір жылды босқа өткізбей, ысыраптамай, әрбір күнді, әрәбір сәтті дұрыс пайдаланы үшін осы сабаққа қатысып өмірін жақсы жаққа өзгертуге бел буған құрметті оқырмандарым!</p>\r\n<p>&nbsp;</p>\r\n<p>Алғашқы сабаығымызды &laquo;ПЕРЕЗАГРУЗКА&raquo; деп атауымның себебі алға дұрыс қадам басу үшін бізге осыған дейін нені дұрыс, нені бұрыс жасағанымызды, қай салада жақсы дамығанымызды және өміріміздің қай саласы кішкене артта қалып &laquo;ақсаңдап&raquo; тұрғанын түсіну қажет. Осылай өз өмірімізді саралаған соң (анализ), ары қарай cізге не керегін, 2021 жылы cіз өміріңіздің қай саласын дамытып, мақсатқа жеткіңіз келетінін түсінесіз.</p>\r\n<p>&nbsp;</p>\r\n<p>Бүгінгі тапсырмаларды орындаған соң, маған &laquo;Не қалайтынымды өзім білмеймін. Мақсатым жоқ&raquo; - деп жазған оқырмандарым қай салада өзгеріп, дамығысы келетінін түсінеді.</p>\r\n<p>&nbsp;</p>\r\n<p>1-тапсырма:</p>\r\n<p>Қателіктеріңізді жазыңыз. Осыған дейін өз мақсатыңызға ұмтылдыңыз ба? ӨЗ қалауыңызды орындауға тырыстыңыз ба? Әлде өзіңнің ішіңе үңілмей, өз қалауыңды ескермей, өзгенің қалауын, мақсатын орындау,а уақыт жоғалттыңыз ба? Қателесудің айыбы жоқ. Қателіктер &ndash; бұл өте жақсы өмірлік тәжірибе. Бастысы &ndash; бір қателікті бірнеше рет қайталамай, одан сабақ алу.</p>\r\n<p>&nbsp;</p>\r\n<p>2-тапсырма:</p>\r\n<p>Өз өміріңіздің диаграммасын сызыңыз. Бірінші қатарға қазір сіздің өміріңізде қай сала бірінші, екінші, үшінші, төртінші, бесіншші, ... орынба тұрғанын рет ретімен жазыңыз және екінші қатарға 2021 жылы өміріңіздің қай саласын дамытқыңыз келетінін рет ретімен жазыңыз</p>\r\n<p>&nbsp;</p>\r\n<p>Өмірге анализ жасау үшін диаграмма. Төмендегі кесте диаграмма мысал. Мысалды дәл осылай көшірмей, өз өміріңізге арнап диаграмма сызып, толтырыңыз.</p>\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p><strong>&nbsp;&nbsp;&nbsp; </strong><strong>1</strong></p>\r\n<p><strong>орында</strong></p>\r\n</td>\r\n<td width=\"46\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td width=\"73\">\r\n<p><strong>&nbsp;&nbsp;&nbsp; 2</strong></p>\r\n<p><strong>орында</strong></p>\r\n</td>\r\n<td width=\"46\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td width=\"73\">\r\n<p><strong>&nbsp;&nbsp;&nbsp; 3</strong></p>\r\n<p><strong>орында</strong></p>\r\n</td>\r\n<td width=\"46\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td width=\"78\">\r\n<p><strong>&nbsp;&nbsp;&nbsp; 4</strong></p>\r\n<p><strong>орында</strong></p>\r\n</td>\r\n<td width=\"46\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td width=\"46\">\r\n<p><strong>&nbsp;&nbsp;&nbsp; 5</strong></p>\r\n<p><strong>орынды</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"78\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"73\">\r\n<p><strong>Қазір</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Өзгелердің қалауы:</p>\r\n<p>та-ана, ата-ене, күйеуі/әйелі</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Бала тәрбиесі</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Үй тірлігі</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"78\">\r\n<p>Өзгелердің өміріне қызығумен уақыт өткізу: инста, сериал т.б.</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>Достармен жиі араласы, жиі қыдыру</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"78\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"73\">\r\n<p><strong>Алдағы уақытта дамытқым келеді</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Бірінші орында &ndash;өзімнің жеке өмірім</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Жұмыс</p>\r\n<p>Даму</p>\r\n<p>Оқу</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"73\">\r\n<p>Материалды байлық: үй, көлік, депозит</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"78\">\r\n<p>Отбасы: әйел/күйеуі, балаларым</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"46\">\r\n<p>Үй тірлігі</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>3-тапсырма:</p>\r\n<p>&nbsp;</p>\r\n<p>Миыңыздағы негативті ойлардан арылыңыз.</p>\r\n<p>ОЙЛАНЫҢЫЗ: Егер сіз өз миыңыздың ішіндегі кедергілерді (негативті ойлар) жеңе алмасаңыз, өмірдің өзге кедергілерін қалай жеңесіз?</p>\r\n<p>Алдымен өзіңізді өзіңіз жеңіңіз!</p>\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Негативті ойлар</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>ПОЗИТИВТІ</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Қорқамын. Менің қолымнан келмейді. Оған қол жеткізе өте қиын.</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>Маған Алла көмектеседі. Ниетіме сай әрекет етсем, Алла жолымды жеңілдетіп, қолдап қуаттайды.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Бізге осы жетеді. Бұдан артығы қайдааа бізге арман ғой&nbsp; (Я не заслуживаю лучшее)</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>Мен жақсы өмір сүруге лайықтымын. Мен әлдеқайда керемет өмір сүруге лайықтымын.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n<p>Мен әлсізбін. Шаршап қала беремін. Күш жігерім жетпейді</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n<p>Мен үнемі денсаулығымды жақсартуға әрекеттенемін және менің энергиям көп! Себебі мен уақытымды және эжнергиямды тек өзіме қажетті істерге арнаймын және нәтижесінде өз мақсатыма жетемін!</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Уақытым жоқ. Үлгермеймін.</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>&nbsp;Мен өз уақытымды дұрыс пайдаланамын. Өз өмірім өз қолымда. Уақытым өз қолымда!</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Мен көп қателестім!</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>Өзімнің қателіктерімді толық кешіремін! Мен көп өмірлік тәжірибе жинадым және дәл қазір бақытты өмір сүруге лайықпын.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>Менің қалауым ешкімге керек емес, алдымен өзгелердің қалауын орындап оларға ұнауым керек</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>Өмір менікі. Менің қалаым мен үшін БІРІНШІ ОРЫНДА!</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n<td width=\"323\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Егер сіздің миыңызда сізге алға қадам басуға кедергі келтіретін өзге негативті ойлар бар болса, тізіміді жалғастырып, оларды ПОЗИТИВТІ ойларға айналдырып, кестенің позитивті бөлімін бірнеше рет қайталаңыз.</p>\r\n<p>&nbsp;</p>\r\n<p>Құрметті сабаққа қатысушылар! Сіздер ересек тұлғасыздар! Осыны ескере отырып, әрбір тапсырманы мен ұшін емес, өзге үшін емес, ӨЗІҢІЗ ҮШІН ОРЫНДАҢЫЗ. Орындалған тапсырманы тексеруге бізге жіберу қажет емес. Себебі сіз үнемі біреудің, тіпті менің &laquo;Дұрыс!&raquo; деген сөзімді күтпей, өз өміріңізге өзіңіз анализ (талдау) жасап, өзіңіз таңдау жасауды үйренуіңіз қажет. Ересек адамның таңдауы өзінде! Тапсырмаларды орындау барысында ненің дұрыс, ненің бұрыстығын өзіңіз түсінесіз! Бастысы &ndash; ішкі әлеміңізді, өз қалауыңызды тыңдаңыз, ішіңіздегі дыбысты естіңіз!</p>\r\n<p>&nbsp;</p>\r\n<p>Іске сәт!</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/16150596984ZiWJ.png',NULL,NULL,780,NULL,'2021-03-06 19:41:38','2021-08-26 12:43:49'),(226,103,'2 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/16170139353aaNG.m4v\" /></video></p>\r\n<p>&nbsp;</p>\r\n<p>Бүгін біз сіздермен бірге сіз қалаған өмірге қарай басты қадамды жасаймыз. Кеттік! <br /> <br />Алдымен сабақты мұқият көріңіз, түсініңіз және дәптеріңіздің бес бетіне сабақта айтылған бес саланы тақырып ретінде жазыңыз. Олар: <br />Бірінші сала &laquo;ЖЕКЕ ӨМІРІМ&raquo; <br />Екінші сала &laquo;ДЕНСАУЛЫҒЫМ&raquo; <br />Үшінші сала &laquo;ОТБАСЫМ&raquo; <br />Төртінші сала &laquo;РУХАНИ БАЙЛЫҚТАРЫМ&raquo; <br />Бесінші сала &laquo;МАТЕРИАЛДЫҚ БАЙЛЫҚТАРЫМ&raquo; <br /> <br />Әрбір салада өзіңіздің 10 мақсатыңызды жазыңыз. Нәтижесінде сізде 5 салада 10 мақсаттан барлығы 50 мақсатыңыз бар! <br /> <br />Мақсаттарыңызды жазу барысыныда оларды ДҰРЫС жазу өте маңызды. Дұрыс жазу үшін әрбір мақсатты жазғанда сол мақсатқа қатысты төмендегі бес сұраққа жауап беріңіз: <br /> <br />1. БҰЛ МАҚСАТ МЕНІКІ МЕ ? <br />2. ОСЫ МАҚСАТҚА ҚАРНЫМ АШ ПА ? <br />3. ҚҰНДЫЛЫҒЫ ЖОҒАРЫ МА? <br /> Мақсатым маған пайдалы ма? <br /> Мақсатым өзгелерге зиян тигізбейді ме? <br /> 4. МАҚСАТЫМ МАҒАН ҚУАНЫШ СЫЙЛАЙДЫ МА? <br /> 5. МАҚСАТЫМ ШЫНАЙЫ ӨМІРГЕ САЙ МА? <br /> <br /> <br /> <br />Мақсатым жоқ болса, нені жазамын? <br /> <br />Мақсатыңыз жоқ деп есептесеңіз, бір бөлмеде не табиғатта тыныштықта 15 минут, небәрі 15 минут уақытыңызды өзіңізге арнап, көзіңізді жұмып, ойша өзіңіздің ішіңізге үңіліңіз және Жаныңыздан сұраңыз &laquo;Жаным, сен нені қалайсың ?&raquo; Иә! Өз жаныңыздан сұраңыз! <br />(&laquo;Жаным&raquo; деген сөзді өз есіміңізге ауыстыруыңызыға болады. <br />Мысал ретінде,: <br />&laquo;Айару, сен нені қалайсың?&raquo; <br />&laquo;Асқар, сен нені қалайсың?&raquo; <br />&laquo;Асқар, сен қандай үйде өмір сүргің келеді?&raquo; <br />&laquo;Ләйлә, сен немен айналысқың келеді?&raquo; <br />&laquo;Дүйсен, сен қандай жалақы алғың келеді, ай сайын қанша теңге табыс тапқың келеді ?&raquo;) <br /> <br />НАҚТЫ ЖАЗЫҢЫЗ <br />Кез-келген мақсатты жазғанда оны барынша нақты жазыңыз. Қандай үй? Қай жерде орналасқан? Нешінші этажда? Балаңыз қай мектепте оқығанын қалайсыз? Неше айда спортта қандай жетістікке жеткіңіз келеді? Неше айда қанша килограммға салмақ тастағыңыз келеді? <br /> <br />ПОЗИТИВТІ ТҮРДЕ ЖАЗЫҢЫЗ <br />Мен арықтаймын емес. Қазіргі салмағыңыз 80 болса, мақсатыңыз: &laquo;Менің салмағым 55 кг&raquo; <br /> <br />Жәй ғана мен 200 000 тг жалақы алатын жұмысқа орналастым емес. Толық, әрі нақты және позитивті деңгейде: &laquo;Мен ..... уақыт аралығында, күніне 8 сағат, аптасына 5 күн істейтін, үйіме жақын орналасқан, өзіме өте ұнайтын және өзгелерге пайдалы жұмысқа орналастым және әр ай сайын қолыма таза 200 000 тг жалақы аламын&raquo; <br /> <br /> <br />МАҚСАТТЫ АНЫҚ НАҚТЫ ТОЛЫҚ ЖАЗУҒА ВИЗУАЛИЗАЦИЯ КӨМЕКТЕСЕДІ. Менің бір танысым Алматының әль-Фараби даңғылының бойында орналасқан ірі &laquo;Нұрлы Тау&raquo; бизнес орталығында жұмыс істеуді армандаған. Ал &laquo;Нұрлы Таудың&raquo; ішінде жүзден астам компаниялар офистері орналасқан (жалға алады). Мақсатын нақты қойып, әрекет еткен досым ірі сақтандыру компаниясына жұмысқа орналасып, дәл осы &laquo;Нұрлы Таудың&raquo; ішінде орналасқан бөлімшесінде жұмыс істеп жүр. Бірақ ол сақтандыру компаниясының Алматы қаласының әр ауданында өте көп бөлімшелері бар. Нақты мақсатын жазып, ұмтылған адам, дәл сол мақсатқа жетеді! Оған күмәніңіз болмасын! Ойыңызға ерік беріңіз! Визуализация жасаңыз... <br /> <br />____________________ <br />Құрметті сабаққа қатысушы! <br />Сабақтан алған әсеріңіз туралы өз пікіріңізбен инстаграм парақшаңызда сторизде бөлісіп, менің @gulmiraqarasai парақшамды белгілесеңіз, сіздерге шын көңілден риза боламын ?</p>','',NULL,'uploads/1615059710Zbkkl.png',NULL,NULL,387,NULL,'2021-03-06 19:41:50','2021-08-26 12:42:46'),(227,103,'3 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1617014221vortn.m4v\" /></video></p>','',NULL,'uploads/16150597233mVzV.png',NULL,NULL,279,NULL,'2021-03-06 19:42:03','2021-08-26 12:43:07'),(228,103,'4 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1617014632Wpt54.m4v\" /></video></p>','',NULL,'uploads/16150597352qeSm.png',NULL,NULL,247,NULL,'2021-03-06 19:42:15','2021-07-22 09:37:16'),(229,103,'5 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1617014807cxaZD.m4v\" /></video></p>','',NULL,'uploads/1615059747xZS9h.png',NULL,NULL,241,NULL,'2021-03-06 19:42:27','2021-07-22 09:37:24'),(230,99,'Қорықпа!','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1614676515lyVEV.m4v\" /></video></p>','',NULL,'uploads/1615060082mBaUM.png',NULL,NULL,478,NULL,'2021-03-06 19:48:02','2021-09-02 06:04:53'),(231,99,'Батыл бол!','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1614676664Ti40f.m4v\" /></video></p>','',NULL,'uploads/1615060113XetLf.png',NULL,NULL,237,NULL,'2021-03-06 19:48:33','2021-09-02 06:05:40'),(232,99,'Сенім!','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1614951033i8KP9.m4v\" /></video></p>','',NULL,'uploads/1615060137APBUA.png',NULL,NULL,226,NULL,'2021-03-06 19:48:57','2021-09-02 06:06:20'),(233,99,'Қорқыныштан арыл медитациясы','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1615049961KVWKx.m4v\" /></video></p>','',NULL,'uploads/1615060171dKxZj.png',NULL,NULL,258,NULL,'2021-03-06 19:49:31','2021-09-02 06:06:56'),(234,102,'1 - сабақ','<p><video controls=\"controls\" width=\"300\" heig