D1%85%D0%BE%D0%B4%D1%8B-%D0%B8-%D1%80%D0%B0%D1%81%D1%85%D0%BE%D0%B4%D1%8B-%D0%B4%D0%B5%D0%BD%D0%B5%D0%B3/id1477982881</a></p>\r\n<p>&nbsp;</p>\r\n<p>2. \"Мой Бюджет\" қосымшасын жүктеуге тікелей сілтеме</p>\r\n<p><a href=\"https://apps.apple.com/kz/app/m%D0%BE%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id1488294897\">https://apps.apple.com/kz/app/m%D0%BE%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id1488294897</a></p>\r\n<p>&nbsp;</p>\r\n<p>3. \"Расход - личный бюджет\" қосымшасын жүктеуге тікелей сілтеме</p>\r\n<p><a href=\"https://apps.apple.com/kz/app/%D1%80%D0%B0%D1%81%D1%85%D0%BE%D0%B4%D1%8B-%D0%BB%D0%B8%D1%87%D0%BD%D1%8B%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id1383365251\">https://apps.apple.com/kz/app/%D1%80%D0%B0%D1%81%D1%85%D0%BE%D0%B4%D1%8B-%D0%BB%D0%B8%D1%87%D0%BD%D1%8B%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id1383365251</a></p>\r\n<p>&nbsp;</p>\r\n<p>4. \"Бюджет ОК: мои расходы доходы\" қосымшасын жүктеуге тікелей сілтеме</p>\r\n<p><br /> https://apps.apple.com/kz/app/%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82-%D0%BE%D0%BA-%D0%BC%D0%BE%D0%B8-%D1%80%D0%B0%D1%81%D1%85%D0%BE%D0%B4%D1%8B-%D0%B4%D0%BE%D1%85%D0%BE%D0%B4%D1%8B/id1330098716</p>\r\n<p>&nbsp;</p>\r\n<p>5. \"Личные финансы и Мой бюджет\" қосымшасын жүктеуге тікелей сілтеме</p>\r\n<p><a href=\"https://apps.apple.com/kz/app/%D0%BB%D0%B8%D1%87%D0%BD%D1%8B%D0%B5-%D1%84%D0%B8%D0%BD%D0%B0%D0%BD%D1%81%D1%8B-%D0%B8-%D0%BC%D0%BE%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id632513433\">https://apps.apple.com/kz/app/%D0%BB%D0%B8%D1%87%D0%BD%D1%8B%D0%B5-%D1%84%D0%B8%D0%BD%D0%B0%D0%BD%D1%81%D1%8B-%D0%B8-%D0%BC%D0%BE%D0%B9-%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82/id632513433</a></p>\r\n<p>&nbsp;</p>\r\n<p>? Осылардың ішінде өзіңізге ыңғайлысын, ұнағанын жүктеп, бастапқыда тегін мүмкіндіктерін қолданып үйреніңіздер</p>\r\n<p>&nbsp;</p>\r\n<p>Жоғарыдағы қосымшалардың Play Market-тегі бейнесі</p>\r\n<p><a href=\"https://ibb.co/7zyCVT9\">https://ibb.co/7zyCVT9</a></p>\r\n<p>&nbsp;</p>\r\n<p>Чем казах отличается от англичанина? </p>\r\n<p>Сын казаха вернулся с учебы в Англии.<br />Отец пристает к нему с вопросами. Уж очень ему интересна чужая жизнь.<br />- Расскажи мне, сынок, - говорит отец, - как живут эти англичане? Что у них не так, как у нас?<br />- Знаешь, папа, по-другому они живут. Во всем по-другому.<br />Вот я, например, жил в семье замечательной пары пожилых исконных англичан. Самое главное отличие от нас в их повседневной жизни &ndash; это экономность или лучше сказать рачительность. Они не отказывают себе в радостях жизни, но и денег бездумно на ветер не бросают.<br />- Например?<br />- Например, они живут в маленькой квартире из двух комнат. Одну из них сдают таким, как я, студентам в аренду. Еще и миссис Флеминг готовит мне завтрак и ужин. За это я тоже ей плачу небольшую плату. А летом, когда они уезжают из Лондона, они и свою комнату сдают в аренду.<br />А теперь, посмотри, папа, на ваш с мамой дом. В нем три этажа, бильярдный зал, тренажерный зал, гостиная на 70 квадратов, несколько спален. Зачем? Дети разъехались, живете одни, гости собираются максимум пять раз в году. Все остальное время большинство комнат пустует. В них заходит только мама, чтобы пыль протереть. И все. А ведь это затраты: комнаты надо отапливать, поддерживать в них порядок, платить за них налоги. Объясни мне, зачем они нужны.<br />- Ну как же, сынок? Казах не может жить в маленьком доме. Это не по-нашему.<br />- Я так и думал. А посмотри на свой автопарк, папа. У тебя большой джип для работы. Хотя твой офис в центре города. До работы проехать по проспекту Аль-Фараби 10 минут. Зачем тебе огромный внедорожник? Ты же не в горы по камням продираешься. Дома для мамы еще одна машина есть. Зачем так много?<br />Вот у мистера и миссис Флеминг есть одна маленькая машинка. На ней удобно ездить по Лондону, парковать легче. И еще у них есть велосипеды. Они на них ездят чаще, чем на машине, несмотря на то, что им под 70 лет. Представляешь? Когда я рассказываю мистеру Флемингу про наши машины, он удивляется. Зачем, чтобы перевезти одного человека &ndash; твоего отца, нужно жечь 15 литров бензина и везти огромный салона воздуха, спрашивает он меня. Ведь этот бензин и деньги на покупку автомобиля не приносят никому практической пользы. Они выбрасываются на ветер. Вот, что обидно.<br />- Ха-ха-ха! Представил себя в &laquo;Мини&raquo; или в &laquo;Гольфе&raquo;. Да меня же друзья засмеют!<br />- Вот! В этом и есть наше отличие. Для нас позорно то, что для англичанина, наоборот, почетно.<br />Пойдем дальше. Я заметил, большинство англичан мало покупает одежду. Ну как мало? По сравнению с нами мало. Например, ты, когда в первый раз приехал в Лондон, помнишь, скупил половину &laquo;Харродса&raquo;. Покупал все подряд. И что? Многое из этой одежды ты вообще не одел ни разу. Кое-что надел пару раз. А ходишь сейчас в одних и тех же трех костюмах, двух джинсах и трех футболках. А в той крутой итальянской одежде, которую купил за бешенные деньги в Лондоне, сейчас ходят наши родственники в Кызылорде и Казалинске. Возможно, даже в огороде в них копаются. Мама отправила им, потому что ты собирался ее выбрасывать. Вот так мы живем.<br />А типичные англичане купят на скидке очень дешево одежду, заносят ее до дыр, а потом еще и через интернет продадут хотя бы за несколько фунтов. Они считают каждый пенс.<br />- Да. Есть такое. Каждый раз покупаю новые вещи, а потом не ношу.<br />- Вещи &ndash; да. А еда? Обрати внимание, как мы готовим себе пищу. Мы ведь объедаемся до отвала три раза в день. Как будто в последний раз. Да еще и половину не доедаем и выбрасываем в мусор. Потому что на следующий день хотим видеть на столе свежеприготовленную пищу. И так каждый день. Одними только нашими остатками еды можно было бы несколько семей в Африке прокормить.<br />А как готовят англичане, например, мистер и миссис Флеминг? Ровно столько, сколько съедят. Ровно две тарелочки. А если не было аппетита, и не доели, то оставят на завтра и доедят.<br />- Как-то скучно это. Не по-людски. Широты душевной нету.<br />- Кстати о душевной широте, а именно о гостеприимстве. Здесь, конечно, нам равных нет. Мы же приглашаем в гости с размахом. Небольшая вечеринка &ndash; 30-50 человек. Свадьба &ndash; 300-500 человек. При этом мы всегда накрываем стол с запасом. На всякий случай. Мы же знаем, что каждый гость может прийти с братом, другом, детьми, внуками, даже с соседом. Когда я рассказываю об этом англичанам, они падают в обморок. Как можно прийти к кому-то на торжество, прихватив с собой незванного гостя. Для них это уму непостижимо. Они приглашают немного гостей и точное количество. По списку. И угощения готовят на точное количество гостей. У них нет понятия накрыть на человек 20-30. Они накрывают ровно на 23 персоны.<br />И потом. Что такое застолье у нас? Это ведь полный дастархан закусок и салатов к началу мероприятия. На столе руки положить некуда. Все заставлено. Так потом еще и за время тоя подают три-четыре горячих. К концу вечера наедаемся так, что встать не можем.<br />А у них? Подают по одному салату, по одному горячему и чай. А чаще и вообще просто закуски и напитки. И все. Ведь у них приходят в гости не для того, чтобы объесться, а чтобы поговорить, пообщаться.<br />- А что? Одно другому мешает?<br />- Не мешает. Но переедать-то зачем?<br />- Не знаю. У нас так принято.<br />- А знаешь, что еще мне бросилось в глаза, когда я поехал в Лондон зимой?<br />- Что?<br />- То, что англичане ходят дома в теплой одежде.<br />- Это почему?<br />- Да потому что, они не топят в доме, как в сауне. Они просто экономят топливо. Они считают, зачем тратить много энергии на обогрев всего дома, если можно просто одеться и ходить в теплой одежде в прохладном доме.<br />А у нас как? Мы же привыкли зимой и летом ходить по дому в трусах и майке. Не остановимся ни перед чем, чтобы разогреть весь дом до 25 градусов. А помнишь, когда мы ездили в гости к дяде Серику в Астану, мы видели, как они укрывают свои батареи ватными одеялами, потому что от них жар шел неимоверный? Еще и форточки открывали. Когда я рассказал об этом мистеру Флемингу, он был просто в шоке. Вы, наверное, очень богаты, говорит он, если можете себе такое позволить.<br />- Дядя Серик же не виноват, что у них там, в Астане, топят на полную катушку, а регулятора тепла на батареях нет. У него же старая панелька, еще советской постройки.<br />- Ну так мистер Флеминг не о дяде Серике говорит. Он в целом о Казахстане говорит.<br />А что ты скажешь про наше освещение, папа? Ты обратил внимание, что у нас во всех комнатах есть центральная люстра минимум на пять рожков и еще множество дополнительных светильников. А ты знаешь, что в большинстве английских домов вообще нет центральной люстры?<br />- Как это?<br />- А вот так. У них есть только отдельные светильники над столом, над зеркалом, торшеры в углах. Они не тратят много энергии на освещение комнат вообще. Они тратят точечно на освещение конкретных мест. И на этом умудряются экономить. Кроме того, у них в подъездах и даже на многих маленьких улицах стоят датчики движения. То есть свет загорается там, только когда проходит человек. В остальное время лампы зря не горят, электричество экономится.<br />А у нас в подъезде свет же горит всю ночь. Ты знаешь об этом? Иногда, если вахтер забудет выключить, то может и еще весь день гореть.<br />Мне уже неудобно про такие мелочи говорить, папа, как ванная комната и туалет. Дотошный и экономный англичанин пока чистит зубы, обязательно выключит кран. Зачем тратить воду без толку? Мы же, как включим воду в начале умывания, так и льем ее, пока не закончим умываться.<br />Или даже такая мелочь: англичанин, если сходил в туалет по-маленькому, обязательно спустит воду в унитазе маленькой кнопкой, то есть потратит полбака воды. А мы разве смотрим на это? У многих в унитазах даже маленькой и большой кнопки нет. Спускаем полный бак от души.<br />- Слушай, я же эту воду или этот свет не украл. Мы честно платим коммунальные платежи. За всю спущенную в унитаз воду я плачу из своих заработанных денег.<br />- Вот это и самое обидное! Ладно, если бы мы поставили &laquo;жучок&raquo; в счетчик и не платили за свет и воду. Я такой шаг не оправдываю, но хотя бы понимаю. Ведь в этом случае мы получили бы какую-то выгоду. Но когда мы просто льем воду в канализацию, жжем без толку свет, обогреваем через форточку улицу, выбрасываем еду на свалку, мы же обкрадываем сами себя безо всякой пользы кому бы то ни было. Просто деньги на ветер! Да, это честно заработанные тобой деньги. Не украденные. Но зачем деньги, заработанные потом и кровью, тратить впустую? А теперь представь, сколько ресурсов выбрасывается на помойку в масштабах страны. Это добытые нашими нефтяниками тонны нефти, выращенные фермерами центнеры зерна, построенные строителями дома. Все они, вся наша нация выбрасывает часть своего богатства в мусор только потому, что ленится выключить кран или потому что хочет пустить пыль в глаза соседу.<br />- Да разве на выключенном вовремя кране или свете разбогатеешь, сынок?<br />- В том-то все и дело, папа, что из этих мелочей и состоит экономика страны. Каждая капля, каждый киловатт понемногу накручивается и превращается в целом в образ жизни. То, что тебе сейчас кажется занудством и мелочностью, для англичан веками формировавшийся образ жизни, который их уже не тяготит, а кажется нормой.<br />- Я бы все равно не смог бы жить как они, считая каждую копейку.<br />- Ну хорошо. Тогда давай жить, как мы привыкли. На широкую ногу. Но только в таком случае давай не будем жаловаться, что мы живем беднее англичан. Давай не будем удивляться, что у них один из самых высоких уровней жизни, а у нас &ndash; нет. Не будем жаловаться, что у них комфортный быт, а у нас &ndash; нет. Не будем завидовать их пенсионерам, которые путешествуют по всему миру, а наши старики копают картошку на огороде до самой старости. Ведь все взаимосвязано. Хотим жить богаче, значит надо жить экономнее.<br />- Да уж&hellip;</p>\r\n<p>(Марат Толибаев.<br />ҚР-ның ауыл шаруашылығының бұрынғы вице-министрі. Қазір бизнесмен )</p>','',NULL,'uploads/1615060484fVyZF.png',NULL,NULL,360,NULL,'2021-03-06 19:54:44','2021-07-22 09:39:12'),(245,100,'2 - сабақ','<p>&nbsp; &nbsp;<video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/161505017937cao.m4v\" /></video></p>','',NULL,'uploads/1615060506Dt5SZ.png',NULL,NULL,194,NULL,'2021-03-06 19:55:06','2021-07-22 09:39:19'),(246,100,'3 - сабақ','<p><video controls=\"controls\" width=\"300\" height=\"150\" controlsList=\"nodownload\">\r\n<source src=\"http://185.113.134.102/videos/16150502717U5gu.m4v\" /></video></p>','',NULL,'uploads/16150605294FycW.png',NULL,NULL,192,NULL,'2021-03-06 19:55:29','2021-07-22 09:39:42'),(247,100,'4 - сабақ','<p><img src=\"https://ibb.co/fQLMtb1\" alt=\"\" /><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1615050364yKzLz.m4v\" /></video><img src=\"https://ibb.co/fQLMtb1\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p>Эйзенхауер матрицасы:</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://ibb.co/fQN0swZ\">https://ibb.co/fQN0swZ</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1615060559xD52C.png',NULL,NULL,209,NULL,'2021-03-06 19:55:59','2021-07-22 09:39:49'),(248,100,'5 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1615051623MZfsZ.m4v\" /></video></p>\r\n<p>&nbsp;</p>\r\n<p>\"Жмот\" фильміне сілтеме:<br /><a href=\"https://gidonline.io/film/zhmot/\">https://gidonline.io/film/zhmot/</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1615060583HYQu6.png',NULL,NULL,187,NULL,'2021-03-06 19:56:23','2021-07-22 09:40:02'),(249,100,'6 - сабақ','<p><video controls=\"controls\" width=\"300\" height=\"150\" controlsList=\"nodownload\">\r\n<source src=\"http://185.113.134.102/videos/1615051758W9WTe.m4v\" /></video></p>','',NULL,'uploads/1615060607jRhG8.png