фирде бірнеше рет қайталап айттым және жаздым. Курста бірден сабақты көріп, таңдау жасап, әрекет етесіздер. Микрозаймы бар адамда 2 ТАҢДАУ БАР!</p>\r\n<ol>\r\n<li>Сот арқылы яғни сотқа талап арыз жазу арқылы шешу</li>\r\n<li>График жасату арқылы шешу</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Бұл курста барлығы 12 видеосабақ.</p>\r\n<p>Курста алғашқы 4 видеосабақ микрозаймды сотқа бермей, қарызды график жасату арқылы шешуге арналған.</p>\r\n<p>Курстың соңғы 8 видеосабағы микрозаймды сот арқылы шешуге арналған.</p>\r\n<p>&nbsp;</p>\r\n<p>PDF құжаттар үлгісі осы 1-видеосабақтың төменгі жағында берілді. Үлгілерді өз телефоныңызға жүктеп алыңыз және электронды почта арқылы ноутбугыңызге жіберіп өзгертіп, толтырасыз.&nbsp; Құжаттар кез-келген телефонда ашылуы үшін, тек PDF форматта беріледі. Оны өздерің жүктеп алып, WORD форматқа айналдыра аласыздар. Жүктелген WORD үлгіні өзіңіз видеосабақта көрсеткенімдей толтырасыз. Ол үшін гуглға &laquo;конвертировать PDF в WORD&raquo; деп жазсаңыз, арнайы тегін өзгертіп беретін сайттар шығады. Қаласаңыз, мына сайт арқылы өзгертуге болады <a href=\"https://www.ilovepdf.com/ru/pdf_to_word\">https://www.ilovepdf.com/ru/pdf_to_word</a>.</p>\r\n<p>Егер бұл сілтеме сіздің құрылғыда ашылмаса, басқа сілтемені гуглға &laquo;конвертировать PDF в WORD&raquo;</p>\r\n<p>Деп жазып, іздеп табасыз.</p>\r\n<p>&nbsp;</p>\r\n<p>ҚАЙ ЖОЛДЫ ТАҢДАЙЫН: Курсты толық көріп, таңдауды өзіңіз жасайсыз. Мен Гүлмира заңгер ретінде микрозаймды шешудің амалдарын осы курста толық түсіндіремін, бірақ сіз үшін таңдау жасай алмаймын. Сіз ересек адамсыз. Таңдау жасау өз қалауыңызға қарай және таңдауыңыздың нәтижесі, жауапкершілік өз мойынызда. На рынке заңгерге жүгінетін болсаңыз, микрозаймды сотқа беру қызметі &ndash; 50 000 теңгеден жоғары, ал микрозайм бойынша график жасатып беру &ndash; 35 000 теңге. Сіз мұның барлығын заңгерге жүгінбей, мұндай ақша төлемей, өзіңіз жасай аласыз. Небәрі 2500 теңгеге алған білімде өте құнды білім жатыр, менің 13 жылдық заңгерлік тәжірибем жатыр.</p>\r\n<p>Бұл курс соңғы рет 2020 жылы сатылымда болған және дәл осы білімді пайдаланып (2020 жылдың желтоқсан айында келген отзывтар бойынша) уже 5000-ға жуық адам микрозаймнан алған қарыздарын процентсіз, тек алған сомасын қайтарып қана құтылған, сот шешімінің нәтижесінде. Оның үстіне сотта жеңіп, Микрозаймға төлеген артық төлемдерін қатйарып алған. Отзывтар инстаграмда @gulmiraqarasai_natizhe парақшасында. Курсқа сұраныс өте жоғары болғандықтан ғана, биыл 2021 жылы соңғы рет қолжетімді бағамен өткізуді жөн көрдім және курс программасына 2021 жылға сәйкес өзгеріс енгіздім.</p>\r\n<p>Сондықтан, сабақты мұқият қараңыздар және видеосабақтың төменіндегі мәтіндерді мұқият оқыңыздар! Әсіресе &laquo;МЕМЛЕКЕТТІК БАЖ&raquo; сабағын көргенде, &laquo;Республикалық бюджет туралы заңға&raquo; сәйкес, биыл 2021 жылы айлық есептік көрсеткіш (АЭК) яғнни месячный расчетный показатель (МРП) өзгергенін <strong>ЕСТЕ САҚТАҢЫЗДАР: МРП - 2917 ТЕҢГЕ !!!!!!!</strong></p>\r\n<p><strong>Демек, егер сіз микрозаймды сот арқылы шешемін деп шешім қабылдасаңыз, онда сотқа талап арыз бергенде мемлекеттік баж/госпошлина төлейсіз және сол мемлекеттік баждың көлемін биылғы 2021 жылғы МРП &ndash; 2917 теңгеден есептейсіз.</strong></p>\r\n<p><strong>&nbsp;</strong></p>','',NULL,'uploads/16288712983HBPC.png',NULL,NULL,141,NULL,'2021-08-13 16:14:58','2021-09-26 12:46:39'),(468,146,'Микрозайм 1 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613913093mnGQt.m4v\" /></video>&nbsp;</p>\r\n<p>Құрметті менің оқырманым, досым, замандасым! Алдарыңызда сіздердің сұраныстарыңызбен сатылымға шыққан &laquo;Микрозаймға артық процент төлеме&raquo; курсы. Микрозаймның не екенін, микрозаймның кредит пен микрокредиттен айырмашылығын осы курстың жарнамасында сториз, пост, тікелей эфирде бірнеше рет қайталап айттым және жаздым. Курста бірден сабақты көріп, таңдау жасап, әрекет етесіздер. Микрозаймы бар адамда 2 ТАҢДАУ 