"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613787983jWore.m4v\" /></video>&nbsp;</p>\r\n<p>Сот арқылы шешу дегенде көпшілік сотқа барып қатысу керек деп ойлайды. Қаласаңыз, істі сіздің қатысуыңызсыз қарауын сұрауға құүқылысыз. Сіздерге берілетін талап арыздың төменгі жағында осындай өтініш жазылған абзац бар. Дегенмен, сот отырысының қай күнге тағайындалғаны туралы сізге смс, хат келуі мүмкін. Мұндай сотқа шақырту автоматты түрде келеді. Егер талап арыздың төменгі жағында сіз сот отырысын сіздің қатысуыңызсыз қарауын сұраған болсаңыз, сот отырысына қатыспауыңызға болады. Егер қаласаңыз, сот отырысына онлайн түрде WhatsApp қосымшасы арқылы видеоқоңыраумен қатыса аласыз. Қазір сот отырыстары онлайн түрде осылай өтеді.</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1628871968KwyG8.png',NULL,NULL,18,NULL,'2021-08-13 16:26:08','2021-09-17 07:34:31'),(484,146,'Микрозайм 9 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613787983jWore.m4v\" /></video>&nbsp;</p>\r\n<p>Сот арқылы шешу дегенде көпшілік сотқа барып қатысу керек деп ойлайды. Қаласаңыз, істі сіздің қатысуыңызсыз қарауын сұрауға құүқылысыз. Сіздерге берілетін талап арыздың төменгі жағында осындай өтініш жазылған абзац бар. Дегенмен, сот отырысының қай күнге тағайындалғаны туралы сізге смс, хат келуі мүмкін. Мұндай сотқа шақырту автоматты түрде келеді. Егер талап арыздың төменгі жағында сіз сот отырысын сіздің қатысуыңызсыз қарауын сұраған болсаңыз, сот отырысына қатыспауыңызға болады. Егер қаласаңыз, сот отырысына онлайн түрде WhatsApp қосымшасы арқылы видеоқоңыраумен қатыса аласыз. Қазір сот отырыстары онлайн түрде осылай өтеді.</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1628871997DEXZw.png',NULL,NULL,28,NULL,'2021-08-13 16:26:37','2021-09-27 05:46:04'),(485,145,'Микрозайм 10 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613788157bv6o2.m4v\" /></video>&nbsp;</p>\r\n<p>Дайын талап арызды сотқа жіберудің екі жолы бар. Видеосабақты көріп, өзіңізге ыңғайлы жолын таңдаңыз. Бірақ, алдымен 8-видеосабақты толық көріңіз. Кейбір келісім шарттарда, тараптар арасында дау туындаған жағдайда, бірден сотқа бермей, алдымен досудебная претензия &ndash; сотқа дейінгі ескерту хат жазуы тиіс, міндетті деп көрсетілуі мүмкін. Мұндай жағдайда алдымен сіз микрозайм компаниясына досудебная перетензия жазасыз. Үлгісі берілді. Досудебная претензия туралы 12-видеосабақта толық түсіндірдім.</p>\r\n<p><strong><u>&nbsp;</u></strong></p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1628872064hqcE0.png',NULL,NULL,19,NULL,'2021-08-13 16:27:44','2021-09-17 07:34:11'),(486,146,'Микрозайм 10 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613788157bv6o2.m4v\" /></video>&nbsp;</p>\r\n<p>Дайын талап арызды сотқа жіберудің екі жолы бар. Видеосабақты көріп, өзіңізге ыңғайлы жолын таңдаңыз. Бірақ, алдымен 8-видеосабақты толық көріңіз. Кейбір келісім шарттарда, тараптар арасында дау туындаған жағдайда, бірден сотқа бермей, алдымен досудебная претензия &ndash; сотқа дейінгі ескерту хат жазуы тиіс, міндетті деп көрсетілуі мүмкін. Мұндай жағдайда алдымен сіз микрозайм компаниясына досудебная перетензия жазасыз. Үлгісі берілді. Досудебная претензия туралы 12-видеосабақта толық түсіндірдім.</p>\r\n<p><strong><u>&nbsp;</u></strong></p>','',NULL,'uploads/1628872090Mjlmr.png',NULL,NULL,30,NULL,'2021-08-13 16:28:10','2021-09-27 06:00:27'),(487,145,'Микрозайм 11 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613788773yFSkS.m4v\" /></video>&nbsp;</p>\r\n<p>Сіз жіберген талап арыздың сотта қалай қаралатынын толық түсіну үшін, осы сабақты мұқият көріңіздер! Әркімнің талап арызы әртүрлі мерзімде қаралуы мүмкін. Кейбір талап арыздар 2 айда қаралып жеңіп шыққан шәкірттерім бар. Кейбірі 2,5-3 ай қарлауы мүмкін. Сотта барлығы судьяға байланысты. Сот шешеімі кімнің пайдасына шығатыны, сотта жеңіп шығуыңыз судьяның шешімініе байланысты.</p>','',NULL,'uploads/1628872132kSZy8.png',NULL,NULL,21,NULL,'2021-08-13 16:28:52','2021-09-18 13:11:52'),(488,146,'Микрозайм 11 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613788773yFSkS.m4v\" /></video>&nbsp;</p>\r\n<p>Сіз жіберген талап арыздың сотта қалай қаралатынын толық түсіну үшін, осы сабақты мұқият көріңіздер! Әркімнің талап арызы әртүрлі мерзімде қаралуы мүмкін. Кейбір талап арыздар 2 айда қаралып жеңіп шыққан шәкірттерім бар. Кейбірі 2,5-3 ай қарлауы мүмкін. Сотта барлығы судьяға байланысты. Сот шешеімі кімнің пайдасына шығатыны, сотта жеңіп шығуыңыз судьяның шешімініе байланысты.</p>','',NULL,'uploads/1628872155CtLt5.png',NULL,NULL,25,NULL,'2021-08-13 16:29:15','2021-09-26 23:22:10'),(489,145,'Микрозайм 12 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613792742NPZJL.m4v\" /></video>&nbsp;</p>\r\n<p>Кейбір келісім шарттарда, тараптар арасында дау туындаған жағдайда, бірден сотқа бермей, алдымен досудебная претензия &ndash; сотқа бергісі келетін тарап, сотқа бергенге дейін екінші тарапқа &laquo;СОТҚА ДЕЙІНГІ ЕСКЕРТУ ХАТ&raquo; жазуы тиіс, міндетті деп көрсетілуі мүмкін. Келісім шартты мұқият оқыңыз. Көбіне бұл туралы келісім шарттың &laquo;Разрешение споров &ndash; Дауды шешу&raquo; бөлімінде көрсетілуі мүмкін. Егер &laquo;обязательно - міндетті&raquo; деп көрсетілсе, мұндай жағдайда алдымен сіз микрозайм компаниясына досудебная перетензия жазасыз. Үлгісі берілді. Досудебная претензия туралы осы видеосабақта толық түсіндірдім. Егер келісім шартта досудебная претензия обязательно деп көрсетілсе, сіз оны жазып, микрозаймға жіберуге және оның көшірмесін талап арызға тіркеуге міндеттісіз. Әйтпесе, судья талап арызды кері қайтаруы мүмкін. Егер досудебная претензия обязательно деп емес, &laquo;вправе&raquo; деп жазылса келісім шартта, мұндай жағдайда талап арызды бірден сотқа жіберуіңізге болады.</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1628872194e6tHn.png',NULL,NULL,33,NULL,'2021-08-13 16:29:54','2021-09-17 07:35:14'),(490,146,'Микрозайм 12 - сабақ','<p><video controlsList=\"nodownload\" controls=\"controls\" width=\"300\" height=\"150\">\r\n<source src=\"http://185.113.134.102/videos/1613792742NPZJL.m4v\" /></video>&nbsp;</p>\r\n<p>Кейбір келісім шарттарда, тараптар арасында дау туындаған жағдайда, бірден сотқа бермей, алдымен досудебная претензия &ndash; сотқа бергісі келетін тарап, сотқа бергенге дейін екінші тарапқа &laquo;СОТҚА ДЕЙІНГІ ЕСКЕРТУ ХАТ&raquo; жазуы тиіс, міндетті деп көрсетілуі мүмкін. Келісім шартты мұқият оқыңыз. Көбіне бұл туралы келісім шарттың &laquo;Разрешение споров &ndash; Дауды шешу&raquo; бөлімінде көрсетілуі мүмкін. Егер &laquo;обязательно - міндетті&raquo; деп көрсетілсе, мұндай жағдайда алдымен сіз микрозайм компаниясына досудебная перетензия жазасыз. Үлгісі берілді. Досудебная претензия туралы осы видеосабақта толық түсіндірдім. Егер келісім шартта досудебная претензия обязательно деп көрсетілсе, сіз оны жазып, микрозаймға жіберуге және оның көшірмесін талап арызға тіркеуге міндеттісіз. Әйтпесе, судья талап арызды кері қайтаруы мүмкін. Егер досудебная претензия обязательно деп емес, &laquo;вправе&raquo; деп жазылса келісім шартта, мұндай жағдайда талап арызды бірден сотқа жіберуіңізге болады.</p>\r\n<p>&nbsp;</p>','',NULL,'uploads/1628872221jOj0B.png',NULL,NULL,35,NULL,'2021-08-13 16:30:21','2021-09-26 23:22:07'),(491,144,'Қорықпа!','<p><video controls=\"controls\" width=\"300\" height=\"150\" controlsList=\"nodownload\">\r\n<source src=\"http://185.113.134.102/videos/1614676515lyVEV.m4v\" /></video></p>','',NULL,'uploads/16305621415VyNR.png',NULL,NULL,113,NULL,'2021-