INSERT INTO `question_answers` VALUES (48,'Сабақтарды қалай көремін?','Өзіңіз таңдаған сабаққа төлем жасап, чектің толық суретін ватсапқа жіберіңіз. Менеджерім сізге сабаққа доступ ашып береді. Ватсап номер 8 747 525 95 12.','2020-12-18 18:26:48','2020-12-18 18:37:41'),(49,'Төлемді қалай жасаймын?','Төлем жасау үшін реквизит:\r\n\r\n? Kaspi Gold\r\nИИН 900 808 401 947\r\nПеревод 87475259512\r\nГулмира Қарасай','2020-12-18 18:29:50','2020-12-18 18:29:50'),(50,'Сабақтар қанша уақыт сақталады?','Сабақтар доступ ашылған соң 20 күн сақталады.','2020-12-18 18:31:07','2020-12-18 18:37:27'),(51,'\"AKSHABAR\" қосымшасын (приложение) өшіріп алсам сабақтарым өшіп қалады ма?','Жоқ, сабағыңыз өшпейді. \"AKSHABAR\"  қосымшасын PlayMarket немесе App Store дан қайта жүктеп алып, сабағыңызды жалғастырып көре аласыз.','2020-12-18 18:37:11','2020-12-18 18:37:11'),(52,'Әр кез сабақ сатып алғанда логин паролім ауысып отырады ма?','Жоқ. Сізге алғаш берген логин парольмен келесі төлем жасаған сабақтарыңызды да көре аласыз.','2020-12-18 18:43:20','2020-12-18 18:43:20'),(54,'Логин паролімді ұмытып қалсам не істеймін?','Қосымшадағы \"ПРОФИЛЬ\" бөліміндегі кері байланыста көрсетілген номерге хабарласыңыз.','2020-12-18 18:49:40','2020-12-18 18:49:40');
/*!40000 ALTER TABLE `question_answers` ENABLE KEYS */;
